import React, { useState, useEffect, useContext } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { listingsAPI } from '../services/api';
import { AuthContext } from '../contexts/AuthContext';
import './Dashboard.css';

const Dashboard = () => {
  const [listings, setListings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [activeTab, setActiveTab] = useState('listings');
  const { user, logout } = useContext(AuthContext);
  const navigate = useNavigate();

  useEffect(() => {
    if (!user) {
      navigate('/login');
      return;
    }
    fetchUserListings();
  }, [user, navigate]);

  const fetchUserListings = async () => {
    try {
      const response = await listingsAPI.getMyListings();
      setListings(response.data);
    } catch (error) {
      console.error('Error fetching listings:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  if (loading) {
    return <div className="loading">Loading dashboard...</div>;
  }

  return (
    <div className="dashboard-container">
      <div className="dashboard-navbar">
        <div className="navbar-center">
          <h1>My Dashboard</h1>
        </div>
        <div className="navbar-right">
          <Link to="/" className="nav-link">Home</Link>
          <button
            className={activeTab === 'favorites' ? 'active' : ''}
            onClick={() => setActiveTab('favorites')}
          >
            Favorites
          </button>
          <button
            className={activeTab === 'messages' ? 'active' : ''}
            onClick={() => setActiveTab('messages')}
          >
            Messages
          </button>
          <button onClick={handleLogout} className="logout-btn">Logout</button>
        </div>
      </div>

      <div className="dashboard-content">
        <div className="dashboard-sidebar">
          <div className="user-info">
            <h3>Welcome back, {user?.name}!</h3>
            <p>{user?.email}</p>
          </div>

          <nav className="dashboard-nav">
            <button
              className={activeTab === 'listings' ? 'active' : ''}
              onClick={() => setActiveTab('listings')}
            >
              My Listings
            </button>
            <button
              className={activeTab === 'profile' ? 'active' : ''}
              onClick={() => setActiveTab('profile')}
            >
              Profile Settings
            </button>
          </nav>
        </div>

        <div className="dashboard-main">
          {activeTab === 'listings' && (
            <div className="listings-section">
              <div className="section-header">
                <h2>My Listings</h2>
                <Link to="/create-listing" className="create-listing-btn">
                  Create New Listing
                </Link>
              </div>

              {listings.length === 0 ? (
                <div className="no-listings">
                  <h3>You haven't created any listings yet</h3>
                  <p>Start renting out your items by creating your first listing!</p>
                  <Link to="/create-listing" className="create-listing-btn">
                    Create Your First Listing
                  </Link>
                </div>
              ) : (
                <div className="listings-grid">
                  {listings.map(listing => (
                    <div key={listing._id} className="listing-card">
                      <div className="listing-image">
                        {listing.images && listing.images.length > 0 ? (
                          <img src={listing.images[0].url} alt={listing.title} />
                        ) : (
                          <div className="no-image">No Image</div>
                        )}
                      </div>

                      <div className="listing-info">
                        <h3>{listing.title}</h3>
                        <p className="category">{listing.category}</p>
                        <p className="price">${listing.price}/day</p>
                        <p className="status">Status: {listing.status}</p>
                        <div className="listing-actions">
                          <Link to={`/listings/${listing._id}`} className="view-btn">
                            View
                          </Link>
                          <button className="edit-btn">Edit</button>
                          <button className="delete-btn">Delete</button>
                        </div>
                      </div>
                    </div>
                  ))}
                </div>
              )}
            </div>
          )}

          {activeTab === 'profile' && (
            <div className="profile-section">
              <h2>Profile Settings</h2>
              <div className="profile-form">
                <div className="form-group">
                  <label>Name</label>
                  <input type="text" value={user?.name || ''} readOnly />
                </div>
                <div className="form-group">
                  <label>Email</label>
                  <input type="email" value={user?.email || ''} readOnly />
                </div>
                <p className="profile-note">
                  Profile editing functionality will be available soon.
                </p>
              </div>
            </div>
          )}

          {activeTab === 'messages' && (
            <div className="messages-section">
              <h2>Messages</h2>
              <div className="no-messages">
                <h3>No messages yet</h3>
                <p>When someone contacts you about your listings, messages will appear here.</p>
              </div>
            </div>
          )}

          {activeTab === 'favorites' && (
            <div className="favorites-section">
              <h2>My Favorites</h2>
              <div className="no-favorites">
                <h3>No favorites yet</h3>
                <p>When you favorite listings, they will appear here for quick access.</p>
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
